\end{align*}

Subtracting $d\cdot y$ from both sides yields
\begin{align*}
n\cdot x\cdot y = m\cdot x\cdot y - d\cdot y.
\end{align*}

Multiplying both sides by $y$ yields
\begin{align*}
n\cdot x = m\cdot x - d.
\end{align*}

Solving for $x$ yields
\begin{align*}
x = \frac{n}{m-d}.
