Substituting $x=\frac{n}{m-d}$ into either equation for $f$ or $g$ yields the same equation for $y$, and the equation for $y$ is a linear equation with constant coefficients.  Thus the graph of $f(x)-g(x)$ is also a line.  Since $f$ and $g$ are increasing, the graph of $f-g$ is also increasing.  The graph of $f(x)-g(x)$ must therefore be a positive slope line.  Since $x=\frac{n}{m-d}$ is between $0$ and $18$, the slope of the graph of $f-g$ must be between $\frac{n}{18}$ and $\frac{n}{0}$, or between $\frac{n}{18}$ and $n$.

