The dashed orange line and the solid green line intersect at the point $p$.  The slope of the dashed orange line is $m$.  The slope of the solid green line is $n$.  Therefore the slope of the graph of $f-g$ is $m-n$.  The slope of the graph of $f-g$ is positive, so $m-n$ is positive.  Thus $m-n\le \frac{n}{18}$.  Therefore
\begin{align*}
\frac{n}{m-d} - \frac{n}{m+d} = \frac{d}{m-d} - \frac{d}{m+d} \ge \frac{d}{m} = \frac{n-d}{mn}.
\end{align*}

If $d\le \frac{n}{2}$, then $\frac{d}{m} \ge \frac{d}{n}$.  Thus $\frac{n-d}{mn}\ge\frac{d}{n}$, and therefore $f(x)-g(x)\le \frac{n-d}{n}$.  Since $d\ge n$, $f(x)-g(x)\le \frac{n}{n}=1$.  Thus the largest value of $f(x)-g(x)$ is $\frac{n}{n}=1$.

